import React,{useState} from 'react'
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as MdIcons from'react-icons/md';
import{Link} from 'react-router-dom';
import {sidebardata} from './sidebardata';

function Navbars() {
    const[sidebar,setsidebar]=useState(false);
    const showsidebar=()=>{
        setsidebar(!sidebar);

    }
    return (
        <>
        <div className="navbar">

        <Link to ="#" className="menu-bars" ></Link>

     <FaIcons.FaBars onClick={showsidebar}/>

        </div>
        <nav className={sidebar?'nav-menuactive':'nav-menu'}>



	<ul className="nav-menu-items">

	 <li className="nav-menu-toggle" style={{display:"inline-block",padding: "0px 10px"}}>

  <Link to ="/" className="menu-items">

<MdIcons.MdOutlineDashboardCustomize/>
  </Link>

    </li> 
    {sidebardata.map((item,index)=>{
        return(
            <>
            <li key={index} className={item.cName}></li>
            <Link to ={item.path}>
            {item.icon}
            <span>{item.title}</span>
            </Link>
            </>
        )
    })}

	<li style={{display:"inline-block",padding: "0px 10px"}}>
    <Link to ="/Signup">Signup</Link>

	</li> 
  <li style={{display:"inline-block",padding: "0px 10px"}}>
  <Link to="/login">Login</Link>
  </li>
   <li style={{display:"inline-block",padding: "0px 10px"}}>
  <Link to="/dashboard">Dashboard</Link>
  </li> 

	</ul>
        </nav>
        </>
    )
}

export default Navbars
